//rfc
//download bootstrap.
//bootsrap npm in terminal
//npm i bootsrap

//npm i react-router-dom
// for link capabilities

import React from 'react';
import { Link } from 'react-router-dom';

export default function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg bg-body-tertiary">
      <div className="container-fluid">
        <a className="navbar-brand" href="#">BookClub Store</a>
        <button className="navbar-toggler"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#navbarSupportedContent"
              aria-controls="navbarSupportedContent" 
              aria-expanded="false"
              aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <Link to="/" className="nav-link">Home</Link>
            </li>
            <li className="nav-item">
              <Link to="/about" className="nav-link">Sales</Link>
            </li>
            <li className="nav-item">
              <Link to="/view-users" className="nav-link">View Users</Link>
            </li>
            <li className="nav-item">
              <Link to="/add-users" className="nav-link">Add Users</Link>
            </li>
            <li className="nav-item">
              <Link to="/add-users-linkedlist" className="nav-link">Add Users Linked List</Link>
            </li>
            <li className="nav-item">
              <Link to="/delete-users-linkedlist" className="nav-link">Delete Users</Link>
            </li>
            <li className="nav-item">
              <Link to="/edit-users-linkedlist" className="nav-link">Edit Users</Link>
            </li>
            <li className="nav-item">
              <Link to="/view-users-linkedlist" className="nav-link">View Users Linked List</Link>
            </li>
            <li className="nav-item">
              <Link to="/delete-users-linkedlist" className="nav-link">Delete Users LL</Link>
            </li>
            <li className="nav-item">
              <Link to="/Edit-users-linkedlist" className="nav-link">Edit Users LL</Link>
            </li>
            <li className="nav-item">
              <Link to="/add-users-linkedlist" className="nav-link">Add Users LL</Link>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
}



